@gubaojian Sorry, dotwe.org don't support entry.js. But you can try this like doc
`
// entry.js
import App from './app.vue'
const meta = weex.requireModule('meta')
//  viewport  640px
meta.setViewport({width: 640})
App.el = '#root'  
new Vue(App)
`
After that, you can see that width sometimes doesn't work.
By the way, it was known that we should set the width immediately on main thread, which ASYN doesn't.
